const start = () => {
    const table = document.querySelector('.custom-table');
    const headers = table.querySelectorAll('th');
    const rows = Array.from(table.querySelectorAll('tbody tr'));

    const form = document.getElementById('riskForm');
    const submitButton = document.getElementById('continueBtn');
    const tableRows = document.querySelectorAll(".custom-table tbody tr");

    const tableCells = document.querySelectorAll("td");

    // Sort rows by the content name (first column)
    rows.sort((a, b) => {
        const cellA = a.querySelector('th').textContent.trim().toLowerCase();
        const cellB = b.querySelector('th').textContent.trim().toLowerCase();
        return cellA.localeCompare(cellB);
    });

    // Append sorted rows to the table body
    const tbody = table.querySelector('tbody');
    rows.forEach(row => tbody.appendChild(row));

    // Add click event to headers for sorting columns
    headers.forEach((header, index) => {
        header.addEventListener('click', () => {
            const isAscending = header.classList.contains('asc');
            headers.forEach(h => h.classList.remove('asc', 'desc'));
            header.classList.toggle('asc', !isAscending);
            header.classList.toggle('desc', isAscending);

            const sortedRows = rows.sort((a, b) => {
                const cellA = a.querySelectorAll('td, th')[index].textContent.trim().toLowerCase();
                const cellB = b.querySelectorAll('td, th')[index].textContent.trim().toLowerCase();
                return isAscending ? cellB.localeCompare(cellA) : cellA.localeCompare(cellB);
            });

            sortedRows.forEach(row => tbody.appendChild(row));
        });
    });

    tableRows.forEach(row => {
        const resultCell = row.cells[1];
        if (resultCell.textContent.trim().toUpperCase() === "HIGH") {
            resultCell.style.color = "red";
        }
        if (resultCell.textContent.trim().toUpperCase() === "LOW") {
            resultCell.style.color = "green";
        }
        if (resultCell.textContent.trim().toUpperCase() === "MEDIUM") {
                resultCell.style.color = "orange"; // Changed from yellow to orange
                resultCell.style.border = "1px solid black";
        }
            const cell = row.cells[1];
        cell.style.fontWeight = "bold";
        cell.style.textTransform = "uppercase";
    });

    if (form && submitButton) {
        document.addEventListener('keydown', function (e) {
            if (e.key === 'Enter' && !e.isComposing) {
                e.preventDefault();  // Prevent the default form submission
                console.log('Enter key pressed');
                submitButton.click(); // Programmatically click the submit button
            }
        });
    } else {
        console.log('Form or submit button not found');
    }
console.log("Right before the if statement");
    // Change the color of the risk level text
    const riskLevelElement = document.querySelector('.text-center.text-success.my-3, .text-center.text-success.my-4');
    if (riskLevelElement) {
        const riskLevelText = riskLevelElement.textContent.trim().toUpperCase();
        console.log("level", riskLevelText);
        if (riskLevelText.includes("HIGH")) {
            riskLevelElement.style.color = "red";
        } else if (riskLevelText.includes("MEDIUM")) {
            riskLevelElement.style.color = "orange";
        } else if (riskLevelText.includes("LOW")) {
            riskLevelElement.style.color = "green";
        }
    }
}

if (document.readyState === "loading") {
